			<p><P> April 17, 1989, Monday, Southland Edition  </P> <P> QUAKE SHAKES AUSTRIA  </P> <P> A "moderately strong" earth tremor, with a magnitude of 4.5, shook buildings in  Austria's mountainous northern Tyrol region early Sunday but caused no damage,  a spokesman for Vienna's meteorological institute said.  </P></p>
